<script>
    function updateOpacity() {
        var opacity = document.getElementById('opacity_slider').value;
        var map = null;
        for(var k in window) { if(window[k] instanceof L.Map) map = window[k]; }
        if(map) {
            map.eachLayer(function(layer) {
                // Vi vill bara ändra fyllda polygoner (Voronoi), inte linjerna (gamla distrikt)
                if (layer.options && layer.options.fillColor && layer.options.fillColor !== 'transparent') {
                    layer.setStyle({fillOpacity: opacity});
                }
            });
        }
    }
</script>
